class Solution {
    class Node {
        int row, col, v;

        public Node(int row, int col, int v) {
            this.row = row;
            this.col = col;
            this.v = v;
        }
    }

    public long maximumValueSum(int[][] board) {
        int n = board.length, m = board[0].length;
        Node[][] a = new Node[n][3];
        for (int i = 0; i < n; i++) {
            int[][] tmp = new int[m][2];
            for (int j = 0; j < m; j++) {
                tmp[j][0] = j;
                tmp[j][1] = board[i][j];
            }
            Arrays.sort(tmp, new Comparator<int[]>() {
                @Override
                public int compare(int[] o1, int[] o2) {
                    return Integer.compare(o2[1], o1[1]);
                }
            });
            for (int j = 0; j < 3; j++) {
                a[i][j] = new Node(i, tmp[j][0], tmp[j][1]);
            }
        }
        long ans = Long.MIN_VALUE;
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                for (int k = j + 1; k < n; k++) {
                    for (int l = 0; l < 3; l++) {
                        for (int o = 0; o < 3; o++) {
                            for (int p = 0; p < 3; p++) {
                                if (a[i][l].col == a[j][o].col || a[i][l].col == a[k][p].col || a[j][o].col == a[k][p].col) continue;
                                if (a[i][l].row == a[j][o].row || a[i][l].row == a[k][p].row || a[j][o].row == a[k][p].row) continue;
                                ans = Math.max(ans, (long) a[i][l].v + a[j][o].v + a[k][p].v);
                            }
                        }
                    }
                }
            }
        }
        return ans;
    }
}
